import ColoredRect from './components/ColoredRect';

function App() {
  return (
    <div className="App">

      {/* <div><Text text="Try click on rect" /></div> */}

      <h1>Click</h1>

      <Stage width={500} height={500}>
          <Layer>

            <ColoredRect xpos={10}/>
          </Layer>
        </Stage>
    </div>
  );
}

export default App;
